const user = "guest@alirezaonline.xyz:~$ "
export default {
    commandExecution(command) {
        let result = '<br/>';
        switch (command) {
            case "-help":
                result += "<br/><table border='1' class='table'><tr><td>clear</td><td>Clear screen</td></tr><tr><td>contact</td><td>Be in touch</td></tr><tr><td>about</td><td>See a brief about me</td></tr><tr><td>skills</td><td>See my skills</td></tr></table>"
                break;
            case "contact":
                result += "E-mail: <a href='mailto:alireza_mortezaei@hotmail.com'>alireza_mortezaei@hotmail.com</a><br/>Phone number: +989360019915<br/>Instagram: <a href='instagram.com/91alim'>@91alim</a>"
                break;
            case "about":
                result += "I graduated from Azad University of Karaj with bachelor degree in Software Engineering. Skilled in php, SQL, HTML, css and javascript and have 4 years of experience in Vue.js and Laravel frameworks. My hobby is art and I'm enthusiast for Technology. I'm also a Linux lover."
                break;
            default: result += "Invalid command..<br/>use '-help' to see valid commands.";
        }
        return result + "<br/>" + user;
    }
}
